import React from 'react';
import WorkshopAttendees from './Components/Admin/WorkshopAttendees';
import AttendeeContextProvider from './Context/AttendeeContext';
import AllWorkshops from './Components/Admin/AllWorkshops';
import WorkshopContextProvider from './Context/WorkshopContext';

function App() {
  return (
    <div className="App">
      <AttendeeContextProvider>
      <WorkshopContextProvider>
        <AllWorkshops /> 
      </WorkshopContextProvider>
      </AttendeeContextProvider>
    </div>
  );
}

export default App;
